import { toast } from "react-toastify";
import moment from "moment";
import mixpanel from "mixpanel-browser";

export const handleErr = (err) => {
  const resMessage =
    err?.response?.data?.message || err?.message || err.toString();
  return resMessage;
};

export const handleSuccess = (resp) => {
  return resp?.data?.data;
};

export const showSuccessMsg = (msg) => {
  toast.success(msg, { autoClose: 2000 });
};

export const showErrMsg = (msg) => {
  toast.error(msg, { autoClose: 2000 });
};

export const navigateTo = (navigate, path) => {
  setTimeout(() => {
    navigate(path);
  }, 400);
};

export const mixPannelEvent = (msg, title, event) => {
  const resp = mixpanel.track(msg, {
    [title]: [event],
  });
  return resp;
};

export function truncateString(
  str,
  firstCharCount = str.length,
  endCharCount = 0,
  startCount
) {
  if (str?.length <= firstCharCount + endCharCount) {
    return str;
  }
  let dotCount = 3;
  const firstPortion = str?.slice(0, startCount);
  const endPortion = str?.slice(-endCharCount);
  const dots = ".".repeat(dotCount);

  return `${firstPortion}${dots}${endPortion}`;
}

