export const timeCalculation = (date) => {
  const expireDate = moment(date);
  let currentDate = moment();
  let monthDiff = expireDate.diff(currentDate, "months");
  let dayDiff = expireDate.diff(currentDate, "days");
  let hourDiff = expireDate.diff(currentDate, "hours");
  let minutesDiff = expireDate.diff(currentDate, "minutes");
  if (monthDiff !== 0) {
    if (monthDiff === 1) {
      return `Expire In ${monthDiff} month`;
    } else {
      return `Expire In ${monthDiff} months`;
    }
  } else if (dayDiff !== 0) {
    if (dayDiff === 1) {
      return `Expire In ${dayDiff} day`;
    } else {
      return `Expire In ${dayDiff} days`;
    }
  } else if (hourDiff !== 0) {
    if (hourDiff === 1) {
      return `Expire In ${hourDiff} hour`;
    } else {
      return `Expire In ${hourDiff} hours`;
    }
  } else if (minutesDiff !== 0) {
    if (minutesDiff === 1) {
      return `Expire In ${minutesDiff} minute`;
    } else {
      return `Expire In ${minutesDiff} minuts`;
    }
  } else {
    return "Expired";
  }
};

export const questionExpire = (date) => {
  const expireDate = moment(date);
  let currentDate = moment();
  let monthDiff = expireDate.diff(currentDate, "months");
  let dayDiff = expireDate.diff(currentDate, "days");
  let hourDiff = expireDate.diff(currentDate, "hours");
  let minutesDiff = expireDate.diff(currentDate, "minutes");
  let isExpired =
    String(hourDiff || monthDiff || dayDiff || minutesDiff).charAt(0) === "-";
  if (isExpired) {
    return "Expired";
  } else {
    if (monthDiff !== 0) {
      if (monthDiff === 1) {
        return `${monthDiff} month left`;
      } else {
        return `${monthDiff} months left`;
      }
    } else if (dayDiff !== 0) {
      if (dayDiff === 1) {
        return `${dayDiff} day left`;
      } else {
        return `${dayDiff} days left`;
      }
    } else if (hourDiff !== 0) {
      if (hourDiff === 1) {
        return `${hourDiff} hour left`;
      } else {
        return `${hourDiff} hours left`;
      }
    } else if (minutesDiff !== 0) {
      if (minutesDiff === 1) {
        return `${minutesDiff} minute left`;
      } else {
        return `${minutesDiff} minuts left`;
      }
    } else {
      return "Expired";
    }
  }
};
